import addIcon from '../resources/add.svg';

function AddNewCookieBtn(props){
    <div className= 'div-add-button'>
        <button type='button' className= 'btn btn-dark'>
            <i class="bi bi-plus-circle-fill"></i>
        </button>
    </div>
}

export default AddNewCookieBtn;
